const probeInput = document.getElementById('probeInput');
const presetSelect = document.getElementById('presetSelect');

let presets = {};        // { name: "12, 43,567", ... }
let currentPreset = "";  // "" или имя
let lastSelectValue = ""; // для отката при cancel

function renderSide(boxEl, arr){
  if(!boxEl || !arr || !arr.length) return;
  arr.forEach(p=>{
    const d=document.createElement('div');
    d.className='probe';
    d.dataset.id=p.id;
    const x = (p.x || 0)*100;
    const y = (p.y || 0)*100;
    d.style.left = x + "%";
    d.style.top  = y + "%";
    boxEl.appendChild(d);
  });
}

function clearSelection(){
  document.querySelectorAll('.probe').forEach(p=>p.classList.remove('active'));
}

function selectProbes(list){
  clearSelection();
  const set=new Set(list);
  document.querySelectorAll('.probe').forEach(p=>{
    const id=p.dataset.id||"";
    const parts=id.split('*');
    if(parts.some(v=>set.has(v))) p.classList.add('active');
  });
}

/* realtime подсветка + авто-сохранение в текущий пресет */
function updateFromInput(){
  const raw = probeInput.value;
  const list = raw.split(/[\s,;]+/).map(s=>s.trim()).filter(Boolean);
  if(!list.length){
    clearSelection();
  }else{
    selectProbes(list);
  }
  if(currentPreset){
    presets[currentPreset] = raw;
  }
}

probeInput.addEventListener('input', updateFromInput);

/* работа с пресетами */
presetSelect.addEventListener('focus', ()=>{
  lastSelectValue = presetSelect.value;
});

presetSelect.addEventListener('change', ()=>{
  const val = presetSelect.value;

  if(val === "__add__"){
    const name = prompt("Preset name, e.g. 03-ICT-030 CH1:");
    if(!name){
      // откат
      presetSelect.value = lastSelectValue || "";
      return;
    }
    // создаём новый пресет
    if(!presets[name]) presets[name] = "";
    currentPreset = name;

    // пересоберём options: (none), все пресеты по алфавиту, Add New...
    rebuildPresetOptions(name);

    // новое имя — поле пустое, подсветка чистая
    probeInput.value = "";
    updateFromInput();
    return;
  }

  // обычный выбор (none или уже существующий пресет)
  if(currentPreset){
    // текущее значение уже и так в presets[currentPreset],
    // потому что мы сохраняем на каждом input.
  }

  if(!val){
    // (none)
    currentPreset = "";
    // поле оставляем как есть, просто подсветка соответствует содержимому
    updateFromInput();
  }else{
    currentPreset = val;
    const text = presets[val] || "";
    probeInput.value = text;
    updateFromInput();
  }
});

function rebuildPresetOptions(selectName){
  // собираем имена
  const names = Object.keys(presets).sort((a,b)=>a.localeCompare(b));
  presetSelect.innerHTML = "";
  // (none)
  const oNone = document.createElement('option');
  oNone.value = "";
  oNone.textContent = "(none)";
  presetSelect.appendChild(oNone);
  // presets
  names.forEach(n=>{
    const opt = document.createElement('option');
    opt.value = n;
    opt.textContent = n;
    presetSelect.appendChild(opt);
  });
  // Add New...
  const oAdd = document.createElement('option');
  oAdd.value = "__add__";
  oAdd.textContent = "Add New...";
  presetSelect.appendChild(oAdd);

  presetSelect.value = selectName || "";
}

/* init viewer */
window.addEventListener('load', ()=>{
  renderSide(topBox, fixtureData.top || []);
  if(fixtureData.bottom && fixtureData.bottom.length && "null"){
    botBox.style.display="inline-block";
    botTitle.style.display="block";
    renderSide(botBox, fixtureData.bottom);
  }
});
</script>
</body>
</html>
